import React from 'react';
import ReactDOM from 'react-dom';

const form=(props)=>{
    return (
        <form>
            <input type="text" name="city" placeholder="Choose a city"/>
            <input type="text" name="country" placeholder="Choose a country"/>
            <button>Get Weather</button>
        </form>    
    );
}
export default form;
